import styled from "styled-components";
import { FaX } from "react-icons/fa6";

function Modal() {
  return (
    <ModalContainer>
      <div></div>
      <ExitBtn>
        <FaX />
      </ExitBtn>
    </ModalContainer>
  );
}
export default Modal;

const ModalContainer = styled.div`
  width: 80%;
  height: 100%;
  background-color: rgba(300, 300, 300, 0.8);
  box-shadow: 0 4px 8px rgba(0, 0, 0, 0.1);
  position: absolute;
  z-index: 10;
  border-radius: 30px;
`;

const ExitBtn = styled.button`
  background-color: #888;
  color: #fff;
  width: 4rem;
  height: 4rem;
  border-radius: 50%;
  position: absolute;
  right: 10px;
  top: 10px;
  cursor: pointer;
  border: none;
  font-size: 20px;
  font-weight: 700;
  text-align: center;
  transition: 0.3s ease all;
  &:hover {
    background-color: #777;
  }
`;
